import React from "react";

export const Moods = ({ mood, text }) => {
  const env = process.env;
  env.PUBLIC_URL = env.PUBLIC_URL || "";

  return (
    <div className="mood_default">
      <img src={process.env.PUBLIC_URL + `/assets/emotion${mood}.png`} />
      <span>{text}</span>
    </div>
  );
};
